def find_median(data):
    data.sort()
    n = len(data)

    if n % 2 == 0:  
        median = (data[n//2] + data[n//2-1])/2
    else: 
        median = data[n//2] 

    return median

if __name__ == "__main__":
    data = [10, 20, 30, 40]
    median = find_median(data)
